package chater1;

public class FloatDoublerTyoe {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//실수 자료형
		//Double을 표준으로 사용
		//float 정밀도는 소수 6자리까지, 
		//Double은 16자리까지 가능
		float fNum = 1.23456789F;
		double dNum = 1.23456789012345678;
		
		System.out.println(fNum);
		System.out.println(dNum);
		}

}
